export default {
  name: 'c-navMenu',
  data: function data() {
    return {
      hoverId: ''
    };
  },
  props: {
    // 组件整体宽度
    width: {
      default: '190',
      type: [Number, String]
    },
    // 元素行高
    lineHidth1: {
      default: '56',
      type: [Number, String]
    },
    // 元素行高
    subLineHidth: {
      default: '56',
      type: [Number, String]
    },
    // 菜单列表
    navList: {
      default: function _default() {
        return [];
      },
      type: Array
    },
    // 默认选中第几个
    navListActive: {
      default: 1,
      type: [Number, String]
    }
  },
  computed: {
    // 组件整体宽度
    boxStyle: function boxStyle() {
      return {
        width: "".concat(this.width, "px")
      };
    },
    topStyle: function topStyle() {
      return {
        top: "".concat((this.lineHidth1 - 18) / 2, "px")
      };
    }
  },
  methods: {
    lineHeightStyle1: function lineHeightStyle1(item) {
      if (item.type === 1) {
        return {
          'line-height': "".concat(this.lineHidth1, "px")
        };
      }

      return {
        'line-height': "".concat(this.subLineHidth, "px")
      };
    },
    heightStyle: function heightStyle(item) {
      if (item.type === 1) {
        return {
          'line-height': "".concat(this.lineHidth1, "px")
        };
      }

      return {
        'line-height': "".concat(this.subLineHidth, "px")
      };
    },
    // 菜单栏点击事件
    listTextChange: function listTextChange(item) {
      this.$emit('listChange', item);
    },
    handMouseenter: function handMouseenter(item) {
      this.hoverId = item.id;
    },
    handMouseleave: function handMouseleave() {
      this.hoverId = '';
    },
    returnClass: function returnClass(item) {
      var str = '';

      if (this.navListActive === item.id) {
        str = 'listActive a-4-bg b-1-cl';
      } else if (this.hoverId === item.id) {
        str = 'listActive b-1-cl a-4-bg';
      } else {
        str = 'nolistActive a-5-bg b-2-cl';
      }

      if (item.type === 1) {
        str = "".concat(str, " medium");
      }

      if (item.type === 2) {
        str = "".concat(str, " min-medium");
      }

      return str;
    }
  }
};
